    false,nt"url": null,nt"notes": "NCEI Accession 0153499 includes physical
    and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1407
    in the waters of unknown oceans from 2014-10-31 to 2014-11-01. These data include
    CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
    (V). The instruments used to collect these data include ADCP and GPS. These data
    were collected by David Checkley of University of California - San Diego; Scripps
    Institution of Oceanography as part of Biological Oceanography Cruise. The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
